window.bookSummaryJSON = "<p>Talent is great if you have it, and luck is fine if you can find it, but Alex Kazemi learned it would take something more to make his dreams come true. It would take magick - a real, spiritual force that anyone can learn to harness.</p> <p>You have the power within you.</p> <p>Magick isn’t a treasured secret for a privileged few. It’s meant for everyone. It’s meant for you. Are you ready to bend reality? Do you want to get out of The Simulation? Do you want to unlock your creative potential? Do you hunger for a more balanced, awakened life? Magick offers this and more.&nbsp;</p> <p>Follow Alex on his journey from a troubled outsider to an enlightened young man as he shares the secret power of Pop Magick.</p>"; 
